import "./App.css";
import Home from "./pages/home";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import MovieSeat from "./pages/movie-seat";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/movie-seat-1" element={<MovieSeat />} />
        <Route path="/movie-seat-2" element={<MovieSeat />} />
        <Route path="/movie-seat-3" element={<MovieSeat />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
